import React from "react";
import styled from "styled-components";
import Header from "./components/Header";

import "./App.css";

function App() {
  return (
    <Container>
      <Header />
    </Container>
  );
}

export default App;

const Container = styled.div`
  height: 70px;
  backgroundcolor: blue;
`;
